import classes from './Login.module.css';

const Login = () => {
  return (
    <div className={classes.Container}>
    <div className={classes.Box}>
      <h1>Login:</h1>
      <input
        className={classes.Input}
        type="text"
        placeholder={'Username'}
      />
      <input
        className={classes.Input}
        type="Password"
        placeholder={'Password'}
      />
    </div>
    </div>
  );
};

export default Login;
